  //}, [setResponseData, responseData])
  return (
      <HomeStyles>

        <Helmet>
          <title>Pubweb Code Challenge</title>
          <meta name="description" content="Pubweb Code Challenge" />
        </Helmet>
        
        <h3>Listings</h3>
        

        <div>
          {listings.map((data, key) => {
            return (
              <>
                <HomeListingCard key={key} data={data} />
              </>
              
            )
          })}
        </div>

      </HomeStyles>
  )
};

export default Home;
